import styles from "./indonesia.module.css"

function Indonesia() {
return (
    <div className={styles.Indonesia}>
    <section className={styles.Indonesia}>
        <h2>Indonesia</h2>
        <h3>Data covid berdasarkan Global</h3>

    </section>

    </div>
)
}
export default Indonesia;
